import React, { useEffect, useState } from 'react';
import axios from 'axios'; // Importa axios para realizar solicitudes a tu API.

export default function Home() {
    const [users, setUsers] = useState([]);

    useEffect(() => {
        // Realiza una solicitud a tu API para obtener la lista de usuarios.
        axios.get('http://localhost/react-js-authentication-laravel/Laravel/public/api/users') // Reemplaza 'URL_DE_TU_API' con la URL real de tu API.
            .then(response => {
                setUsers(response.data.users);
            })
            .catch(error => {
                console.error('Error al obtener la lista de usuarios:', error);
            });
    }, []);

    return (
        <div>
            <h1>Lista de Usuarios</h1>
            <ul>
                {users.map(user => (
                    <li key={user.id}>{user.name} - {user.email}</li>
                    // Personaliza cómo deseas mostrar los datos de cada usuario.
                ))}
            </ul>
        </div>
    );
}
